import React, { useState } from 'react';
import './Fleetmanagemnt.css';


const trucks = [
  {
    id: 'TRK-001',
    model: 'Volvo FH16',
    location: 'Mumbai Terminal',
    serviceDate: '15/4/2024',
    capacity: '25,000 L',
    status: 'Active'
  },
  {
    id: 'TRK-002',
    model: 'Scania R Series',
    location: 'Delhi Depot',
    serviceDate: '10/4/2024',
    capacity: '30,000 L',
    status: 'Maintenance'
  },
  {
    id: 'TRK-003',
    model: 'Mercedes Actros',
    location: 'Bangalore Hub',
    serviceDate: '20/4/2024',
    capacity: '28,000 L',
    status: 'Active'
  }
];

const FleetManagement = () => {
  const [search, setSearch] = useState('');
  const [filter, setFilter] = useState('All');

  const filteredTrucks = trucks.filter(truck => {
    const matchesSearch =
      truck.id.toLowerCase().includes(search.toLowerCase()) ||
      truck.model.toLowerCase().includes(search.toLowerCase());
    const matchesFilter =
      filter === 'All' || truck.status === filter;
    return matchesSearch && matchesFilter;
  });

  return (
    <div className="fleet-container">
      <h2>Fleet Management</h2>

      <div className="fleet-controls">
        <input
          type="text"
          placeholder="Search by plate or model..."
          value={search}
          onChange={e => setSearch(e.target.value)}
        />
        <select value={filter} onChange={e => setFilter(e.target.value)}>
          <option value="All">All Status</option>
          <option value="Active">Active</option>
          <option value="Maintenance">Maintenance</option>
        </select>
      </div>

      <div className="truck-list">
        {filteredTrucks.map(truck => (
          <div key={truck.id} className={`truck-card ${truck.status.toLowerCase()}`}>
            <h3>{truck.id}</h3>
            <p><strong>Model:</strong> {truck.model}</p>
            <p><strong>Location:</strong> {truck.location}</p>
            <p><strong>Next Service:</strong> {truck.serviceDate}</p>
            <p><strong>Capacity:</strong> {truck.capacity}</p>
            <p><strong>Status:</strong> <span className="status">{truck.status}</span></p>
            <div className="truck-actions">
              <button>View Details</button>
              <button>Schedule Service</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FleetManagement;
